# Define the move_column function
def move_column(df, column_name, index):
    """
    Moves a column in a Pandas DataFrame to a specified index.

    Args:
        df (pd.DataFrame): The input DataFrame.
        column_name (str): The name of the column to move.
        index (int): The zero-based index where the column should be moved.

    Returns:
        pd.DataFrame: The DataFrame with the column moved.
    """
    # Get the list of columns
    cols = df.columns.tolist()

    # Remove the column from its current position
    cols.pop(cols.index(column_name))

    # Insert the column at the desired index
    cols.insert(index, column_name)

    # Reindex the DataFrame with the new column order
    return df[cols]

# Now call the move_column function
